import React, { useState } from "react";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

const FarmerDashboard = () => {
  const [farmer, setFarmer] = useState({
    name: "John Doe",
    email: "johndoe@example.com",
    phone: "123-456-7890",
  });

  const [isEditing, setIsEditing] = useState(false);

  const validateForm = () => {
    if (!farmer.name || !farmer.email || !farmer.phone) {
      toast.error("All fields are required!");
      return false;
    }
    if (!/\S+@\S+\.\S+/.test(farmer.email)) {
      toast.error("Please enter a valid email address!");
      return false;
    }
    if (!/^\d{3}-\d{3}-\d{4}$/.test(farmer.phone)) {
      toast.error("Please enter a valid phone number (e.g. 123-456-7890)");
      return false;
    }
    return true;
  };

  const handleEditProfile = () => {
    setIsEditing(true);
  };

  const handleLogout = () => {
    // Add logout logic
    toast.success("Logged out successfully!");
  };

  const handleSaveProfile = () => {
    if (validateForm()) {
      // Add save profile logic (e.g., send data to a server)
      setIsEditing(false);
      toast.success("Profile saved successfully!");
    }
  };

  return (
    <div className="container mt-5">
      <div className="row">
        {/* Farmer Profile */}
        <div className="col-md-4">
          <div className="card p-4 shadow">
            <h2 className="text-center">Farmer Profile</h2>
            {isEditing ? (
              <div>
                <div className="mb-3">
                  <input
                    type="text"
                    className="form-control"
                    value={farmer.name}
                    onChange={(e) =>
                      setFarmer({ ...farmer, name: e.target.value })
                    }
                  />
                </div>
                <div className="mb-3">
                  <input
                    type="email"
                    className="form-control"
                    value={farmer.email}
                    onChange={(e) =>
                      setFarmer({ ...farmer, email: e.target.value })
                    }
                  />
                </div>
                <div className="mb-3">
                  <input
                    type="text"
                    className="form-control"
                    value={farmer.phone}
                    onChange={(e) =>
                      setFarmer({ ...farmer, phone: e.target.value })
                    }
                  />
                </div>
                <button
                  className="btn btn-primary w-100"
                  onClick={handleSaveProfile}
                >
                  Save Profile
                </button>
              </div>
            ) : (
              <div>
                <p>
                  <strong>Name:</strong> {farmer.name}
                </p>
                <p>
                  <strong>Email:</strong> {farmer.email}
                </p>
                <p>
                  <strong>Phone:</strong> {farmer.phone}
                </p>
                <button
                  className="btn btn-warning w-100 mb-2"
                  onClick={handleEditProfile}
                >
                  Edit Profile
                </button>
              </div>
            )}
            <button className="btn btn-danger w-100" onClick={handleLogout}>
              Logout
            </button>
          </div>
        </div>

        {/* Market Rates Table */}
        <div className="col-md-8">
          <div className="card p-4 shadow">
            <h2 className="text-center">Market Rates</h2>
            <table className="table table-bordered mt-3">
              <thead>
                <tr>
                  <th>Crop</th>
                  <th>Rate per Kg</th>
                  <th>Availability</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>Tomato</td>
                  <td>$2.5</td>
                  <td>In stock</td>
                </tr>
                <tr>
                  <td>Potato</td>
                  <td>$1.8</td>
                  <td>In stock</td>
                </tr>
                <tr>
                  <td>Carrot</td>
                  <td>$3.0</td>
                  <td>In stock</td>
                </tr>
              </tbody>
            </table>
          </div>
        </div>
      </div>

      {/* Toastify Notifications */}
      <ToastContainer />
    </div>
  );
};

export default FarmerDashboard;
